function Faqs() {
  return (
    <div className="faqs">
      <h1 className="page-title">FAQs</h1>
      <p className="page-title ">Frequently asked questions</p>
      <p className="page-title">
        If you have any questions not answered below, then please contact us.
      </p>

      <p className="faqs-question">Q. When can I place my order?</p>
      <p className="faqs-answer">
        You can place your order at any time, 24/7.{" "}
      </p>
      <p className="faqs-question">Q. How much dose shipping cost?</p>
      <p>Shipping cost is $10.</p>
      <p className="faqs-question">Q. My address is wrong, what can I do?</p>
      <p>Please contact to us as soon as possible. </p>
    </div>
  );
}

export default Faqs;
